import React from "react";
import "../App.css";

const TaskItem = ({ id, taskName, deadline, status, toggleTaskCompletion }) => {
  return (
    <tr>
      <td>{id}</td>
      <td>{taskName}</td>
      <td>{deadline}</td>
      <td><input type="checkbox" className="checkbox" value={status} onChange={toggleTaskCompletion(id)}></input></td>
    </tr>
  );
};

export default TaskItem;
